سرعة بديهة:
يُقال بأنّ شاعراً دخل على أحد الملوك فقال له الملك (وا) فرد عليه الشاعر (إنّ)
فغضب الملك وأمر بطرده. فتعجب الناس مما حدث، فقال لهم الملك: أنا قلت (وا) إشارة لقوله تعالى { والشعراء يتبعهم الغاوون} فرد عليّ وقال (إنّ) يقصد قوله تعالى { إنّ الملوك إذا دخلوا قرية أفسدوها}
